import "./style2.css"

import $ from "jquery";

import React, { Component } from "react";

import v from "./images/v.png";
import gitCat from "./images/gitCat.png"
import linkedIn from "./images/linkedIn.jpg"


class index2 extends Component {

    componentDidMount(){
    $('.winMenu').addClass("hidden");
}

    render() {

        
           

        function show() {

            $('.winMenu').addClass("hidden");


            $('.winStart').click(function () {


                if ($(".winMenu").hasClass("hidden")) {
                    $(".winMenu").removeClass("hidden").addClass("visible");

                } else {
                    $(".winMenu").removeClass("visible").addClass("hidden");
                }
            });
        }
        return (

            <div>

                    <div className="col-sm-12 windows">
                        <div className="winMenu">
                            <div className="winMenuHeader"><img src={v} height="60%" />Victor Politano</div>
                           <div className="winMenuItem"><a href="#/portfolio">My Portfolio</a></div> 
                           <div className="winMenuItem"><a target="_blank" rel="noopener noreferrer" href="https://github.com/viant3"><img 
                            src={gitCat} height="50%" alt="GitHub" />My Github</a></div> 
                           {/* <div className="winMenuItem"> <a target="_blank" rel="noopener noreferrer" href="https://linkedin.com/in/victor-politano-a14b98151"><img 
                            src={linkedIn} height="50%" alt="LINKEDIN" />My LinkedIn</a></div> */}
                           <div className="winMenuItem"><a href="#/visitor">Sign My Guestbook</a></div> 
                          
                        </div>
                    </div>


                    <div className="winFooter">

                         <div className="winStart" onClick={show}>Start</div>
                        <div></div>
                    </div>

            </div>

        );
    }
}

export default index2;
